window.convertToBytesForIr = (str)=>{
    let bytes = new Uint8Array(str.length / 2);
    for (let i = 0; i < str.length; i += 2) {
        bytes[i / 2] = parseInt(str.substr(i, 2), 16);
    }
    return bytes;
}
window.matchData = (tmp_rcv,maxHeight,len)=>{
    let Max_h = maxHeight; 
    let Ln = len;
    let d1 = new Uint8Array(Ln);
    let maxSeach = 0;
    let hMax = 0;
    let bytes = convertToBytesForIr(tmp_rcv);
    let indexObj = {};
    d1[0] = bytes[0];
    d1[1] = bytes[1];
    d1[2] = bytes[2];
    console.log("d1[1]",d1[1]);
    console.log("d1[2]",d1[2]);
    for (let t = 2; t < Ln; t++) {
      d1[t] = bytes[t];
    }

    for (let j = 0; j < Max_h; j++) {
      let d2 = new Uint8Array(Ln);
      for (let i = 0; i < Ln; i++) {
        d2[i] = erp.yj_list_buf[j][i];
      }

      let m = 0;
      // Compare the first two elements
      if (d1[1] === d2[1] && d1[2] === d2[2]) { 
        for (let i = 2; i < 38; i++) {
          if (d2[i] === 255) {
            if (d1[i] === d2[i]) {
              m++;
            }
          } else {
            const dif = Math.floor(d1[i] * 0.1); // 10%
            const min = d1[i] - dif;
            const max = d1[i] + dif;
            if (min <= d2[i] && max >= d2[i]) {
              m++;
            }
          }
        }

        // Check remaining elements
        for (let i = 38; i < Ln; i++) {
          if (d2[i] === 15 || d2[i] === 240) {
            break;
          }
          if (d1[i] === d2[i]) {
            m++;
          }
        }
      }

      // Update max matches
      if (m > 0) {
        // maxSeach = m;
        // hMax = j;
        indexObj[j] = m;
      }
    }
    
    // Prepare the search buffer using the matched index
    // let seachbuf = new Uint8Array(2);
    // seachbuf[0] = maxSeach;
    // seachbuf[1] = hMax;

    return indexObj;
}

